description:
Emulsión Hidratante Corporal, para pieles secas, con una efectiva combinación ingredientes: urea al 5%, componente natural de la piel con propiedades hidratantes y extracto de caléndula, reconocido acondicionador que suaviza y alivia la piel. Nbsp; Crema Diabet Tx Emulsión 5% Urea y Caléndula 200 ml Goicoechea
Emulsión Hidratante Corporal, para pieles secas, con una efectiva combinación ingredientes: urea al 5%, componente natural de la piel con propiedades hidratantes y extracto de caléndula, reconocido acondicionador que suaviza y alivia la piel. Nbsp;
Especialmente formulada para pieles extremadamente secas como la de los diabéticos. La nueva Goicoechea DiabetTX Emulsión Corporal Hidratante, con un plus de urea y caléndula, le brinda a la piel hidratación instantánea, mientras ayuda a prevenir la pérdida de agua y mejora notablemente la condición de la barrera cutánea. Nbsp;
Repara la resequedad en una sola aplicación, reduciendo la descamación y agrietamiento, favoreciendo así el proceso de regeneración de la piel. Hipoalergénica, de textura ligera que permite su absorción al instante, evitando esa sensación pegajosa en la piel.
